import {View,Text,Image,StyleSheet} from "react-native"

const Company=(props)=>{
    const companyData=props.companyData
    return (
        <View>
            {companyData.map((company)=>{
                return (
                    <Text>
                        {JSON.stringify(company)}
                    </Text>
                );
            })}
    </View>
    )
}

const styles=StyleSheet.create({
    companyImage:{
        width:300,
        height:300
    },
    companyTitle:{
        fontSize:30,
        fontWeight:"bold"
    }
})

export default Company
